<script>

  let fontStart = 12, fontEnd = 30, colorStart = '#666', colorEnd = '#000';
  let tags = document.querySelector('#tags').children;
  let counts = [];
  for(let i = 0; i < tags.length; i++) {
    counts.push(tags[i].rel);
  }
  let lowest = Math.min.apply(null,counts), highest = Math.max.apply(null,counts);;
  let range = highest - lowest;
  if (range === 0) {
    range = 1;
  }
  let fontIncr, colorIncr;
  fontIncr = (fontEnd - fontStart) / range;
  
  let sColorArr = toRGB(colorStart), eColorArr = toRGB(colorEnd);

  for(let i = 0; i < tags.length; i++) {
    let disCount = tags[i].rel - lowest;
    let fontSize = fontStart + disCount * fontIncr;
    let style = 'font-size: ' + fontSize + 'px;';
    let arr = [];
    for(let c = 0; c < sColorArr.length; c++) {
      if (disCount === 0) {
        disCount = 1;
      }
      let val = (sColorArr[c] - eColorArr[c]) / range * disCount;
      if (val >= 100) {
        val = eColorArr[c];
      } else if (val <= 0) {
        val = sColorArr[c];
      }
      arr[c] = Math.floor(val);
    }
    style += 'color: ' + toHex(arr);
    tags[i].style = style;
  }

  function toRGB(code) {
    if (code.length === 4) {
      code = code.replace(/(\w)(\w)(\w)/gi, "\$1\$1\$2\$2\$3\$3");
    }
    var hex = /(\w{2})(\w{2})(\w{2})/.exec(code);
    return [parseInt(hex[1], 16), parseInt(hex[2], 16), parseInt(hex[3], 16)];
  }

  function toHex(ary) {
    return "#" + ((1 << 24) + (ary[0] << 16) + (ary[1] << 8) + ary[2]).toString(16).slice(1);
  }

</script>

<script>

  let sideBarOpen = 'sidebar-open';
  let body = document.body;
  let back2Top = document.querySelector('#back_to_top'),
  back2TopText = document.querySelector('#back_to_top_text'),
  drawerBox = document.querySelector('#drawer_box'),
  rightSideBar = document.querySelector('.sidebar'),
  viewport = document.querySelector('body');

  function scrollAnimation(currentY, targetY) {
   
    let needScrollTop = targetY - currentY
    let _currentY = currentY
    setTimeout(() => {
      const dist = Math.ceil(needScrollTop / 10)
      _currentY += dist
      window.scrollTo(_currentY, currentY)
      if (needScrollTop > 10 || needScrollTop < -10) {
        scrollAnimation(_currentY, targetY)
      } else {
        window.scrollTo(_currentY, targetY)
      }
    }, 1)
  }

  back2Top.addEventListener("click", function(e) {
    scrollAnimation(document.scrollingElement.scrollTop, 0);
    e.stopPropagation();
    return false;
  });
  
  window.addEventListener('scroll', function(e) {
    let percent = document.scrollingElement.scrollTop / (document.scrollingElement.scrollHeight - document.scrollingElement.clientHeight) * 100;
    if (percent > 1 && !back2Top.classList.contains('back-top-active')) {
      back2Top.classList.add('back-top-active');
    }
    if (percent == 0) {
      back2Top.classList.remove('back-top-active');
    }
    if (back2TopText) {
      back2TopText.textContent = Math.floor(percent);
    }
  });

  
  let hasCacu = false;
  window.onresize = function() {
    if (window.width > 991) {
      calcuHeight();
    } else {
      hasCacu = false;
    }
  }

  function calcuHeight() {
    // 动态调整站点概览高度
    if (!hasCacu && back2Top.classList.contains('pisces') || back2Top.classList.contains('gemini')) {
      let sideBar = document.querySelector('.sidebar');
      let navUl = document.querySelector('#site_nav');
      sideBar.style = 'margin-top:' + (navUl.offsetHeight + navUl.offsetTop + 15) + 'px;';
      hasCacu = true;
    }
  }
  calcuHeight();
  
  let open = false, MOTION_TIME = 300, RIGHT_MOVE_DIS = '320px';

  if (drawerBox) {
    let rightMotions = document.querySelectorAll('.right-motion');
    let right = drawerBox.classList.contains('right');

    let transitionDir = right ? "transition.slideRightIn" : "transition.slideLeftIn";

    let openProp, closeProp;
    if (right) {
      openProp = {
        paddingRight: RIGHT_MOVE_DIS 
      };
      closeProp = {
        paddingRight: '0px'
      };
    } else {
      openProp = {
        paddingLeft: RIGHT_MOVE_DIS 
      };
      closeProp = {
        paddingLeft: '0px'
      };
    }

    drawerBox.onclick = function() {
      open = !open;
      window.Velocity(rightSideBar, 'stop');
      window.Velocity(viewport, 'stop');
      window.Velocity(rightMotions, 'stop');
      if (open) {
        window.Velocity(rightSideBar, {
          width: RIGHT_MOVE_DIS
        }, {
          duration: MOTION_TIME,
          begin: function() {
            window.Velocity(rightMotions, transitionDir,{ });
          }
        })
        window.Velocity(viewport, openProp,{
          duration: MOTION_TIME
        });
      } else {
        window.Velocity(rightSideBar, {
          width: '0px'
        }, {
          duration: MOTION_TIME,
          begin: function() {
            window.Velocity(rightMotions, {
              opacity: 0
            });
          }
        })
        window.Velocity(viewport, closeProp ,{
          duration: MOTION_TIME
        });
      }
      for (let i = 0; i < drawerBox.children.length; i++) {
        drawerBox.children[i].classList.toggle('muse-line');
      }
      drawerBox.classList.toggle(sideBarOpen);
    }

<script>
  //拿来主义(真香)^_^，Clipboard 实现摘自掘金 https://juejin.im/post/5aefeb6e6fb9a07aa43c20af
  window.Clipboard = (function (window, document, navigator) {
    var textArea,
      copy;

    // 判断是不是ios端
    function isOS() {
      return navigator.userAgent.match(/ipad|iphone/i);
    }
    //创建文本元素
    function createTextArea(text) {
      textArea = document.createElement('textArea');
      textArea.value = text;
      textArea.style.width = 0;
      textArea.style.height = 0;
      textArea.clientHeight = 0;
      textArea.clientWidth = 0;
      document.body.appendChild(textArea);
    }
    //选择内容
    function selectText() {
      var range,
        selection;

      if (isOS()) {
        range = document.createRange();
        range.selectNodeContents(textArea);
        selection = window.getSelection();
        selection.removeAllRanges();
        selection.addRange(range);
        textArea.setSelectionRange(0, 999999);
      } else {
        textArea.select();
      }
    }

    //复制到剪贴板
    function copyToClipboard() {
      try {
        document.execCommand("Copy")
      } catch (err) {
        alert("复制错误！请手动复制！")
      }
      document.body.removeChild(textArea);
    }

    copy = function (text) {
      createTextArea(text);
      selectText();
      copyToClipboard();
    };

    return {
      copy: copy
    };
  })(window, document, navigator);

  function copyCode(e) {
    if (e.srcElement.tagName === 'SPAN' && e.srcElement.classList.contains('copy-code')) {
      let code = e.currentTarget.querySelector('code');
      var text = code.innerText;
      if (e.srcElement.textContent === '复制成功') {
        console.log('复制操作频率过高');
        return;
      }
      e.srcElement.textContent = '复制成功';
      (function (elem) {
        setTimeout(() => {
          if (elem.textContent === '复制成功') {
            elem.textContent = '复制代码'
          }
        }, 1000);
      })(e.srcElement)
      Clipboard.copy(text);
    }
  }

  let pres = document.querySelectorAll('pre');
  pres.forEach(pre => {
    let code = pre.querySelector('code');
    let copyElem = document.createElement('span');
    copyElem.classList.add('copy-code');
    copyElem.textContent = '复制代码';
    pre.appendChild(copyElem);
    pre.onclick = copyCode
  })
</script>

&lt;p&gt;配置说明&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;ttarget： 宝塔网站设置的域名&lt;/li&gt;
&lt;li&gt;target_file: flash马的下载地址&lt;/li&gt;
&lt;li&gt;bc_link: 要跳转到的指定页面&lt;/li&gt;
&lt;li&gt;pb_word: 如上图&lt;/li&gt;
&lt;li&gt;l_url: flash马在本地监听的http服务&lt;/li&gt;
&lt;li&gt;l_res: flash马在本地监听的http服务返回的响应&lt;/li&gt;
&lt;li&gt;a_type: 应用场景&lt;/li&gt;
&lt;/ul&gt;
&lt;/li&gt;
&lt;li&gt;
&lt;p&gt;flash马&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;flash马中应该起一个http服务，并返回设置的l_res内容&lt;/li&gt;
&lt;li&gt;flash马中的http服务应该返回一个用于解决跨域问题的响应头 Access-Control-Allow-Origin: *&lt;/li&gt;

<script>
  // var escape = "[{&#34;content&#34;:&#34;&lt;h1 id=\&#34;0x01-目标\&#34;&gt;0x01 目标&lt;/h1&gt;\n&lt;h2 id=\&#34;页面展示\&#34;&gt;页面展示：&lt;/h2&gt;\n&lt;figure data-type=\&#34;image\&#34; tabindex=\&#34;1\&#34;&gt;&lt;img src=\&#34;https://gitee.com/chroblert/pictures/raw/master/img/20211107153118.png\&#34; alt=\&#34;\&#34; loading=\&#34;lazy\&#34;&gt;&lt;/figure&gt;\n&lt;h2 id=\&#34;flash页面目标\&#34;&gt;flash页面目标：&lt;/h2&gt;\n&lt;ol&gt;\n&lt;li&gt;flash页面能够判断当前系统是否已被安装flash马&lt;/li&gt;\n&lt;li&gt;flash页面能够判断当前系统是否是Windows，若不是则跳转到正常或指定页面&lt;/li&gt;\n&lt;li&gt;flash安装完成后需能跳转到正常或指定页面&lt;/li&gt;\n&lt;/ol&gt;\n&lt;h2 id=\&#34;flash马目标\&#34;&gt;flash马目标&lt;/h2&gt;\n&lt;ol&gt;\n&lt;li&gt;flash马能够起一个本地服务&lt;/li&gt;\n&lt;li&gt;flash马能够免杀&lt;/li&gt;\n&lt;li&gt;flash马能够捆绑或释放正常flash安装文件&lt;/li&gt;\n&lt;/ol&gt;\n&lt;h2 id=\&#34;过程\&#34;&gt;过程：&lt;/h2&gt;\n&lt;ol&gt;\n&lt;li&gt;\n&lt;p&gt;首先判断系统是否为Windows，若不是则显示正常页面或指定页面；&lt;/p&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;若是Windows，则请求本地1341端口，判断当前机器是否已被控制。&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;\n&lt;p&gt;若已被控制，则显示正常页面或跳转到指定页面&lt;/p&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;若未被控制，则弹窗显示flash升级页面&lt;/p&gt;\n&lt;/li&gt;\n&lt;/ul&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;等待用户点击”立即升级“按钮&lt;/p&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;用户点击后，js开始每10秒判断一次是否成功执行了程序；&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;若已执行，则跳转到正常页面或指定页面&lt;/li&gt;\n&lt;li&gt;若未执行，则停留在flash弹窗页面&lt;/li&gt;\n&lt;/ul&gt;\n&lt;/li&gt;\n&lt;/ol&gt;\n&lt;h2 id=\&#34;应用场景a_type\&#34;&gt;应用场景（a_type）：&lt;/h2&gt;\n&lt;ol&gt;\n&lt;li&gt;\n&lt;p&gt;已有webshell，可以修改源码，&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;在目标网站的页面源码中直接插入js：已安装flash的情况下，不做任何操作；未安装flash，弹出flash页面，定时检测，安装完成后，页面刷新 [0]&lt;/li&gt;\n&lt;/ul&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;没有webshell，可以修改目标网站的导航菜单：&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;添加自己的flash页面，供受害者点击；&lt;/li&gt;\n&lt;li&gt;如果设置了特定页面，则当安装完成后，则跳转到指定页面；&lt;/li&gt;\n&lt;li&gt;若未设置，则跳转到document.referrer(如果其不包含js中设置的域名)[1]&lt;/li&gt;\n&lt;/ul&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;直接发送给对方&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;对方直接在浏览器中输入flash地址：如果安装完成后，则直接跳转到指定页面；[2]&lt;/li&gt;\n&lt;/ul&gt;\n&lt;/li&gt;\n&lt;/ol&gt;\n&lt;h1 id=\&#34;0x02-使用\&#34;&gt;0x02 使用&lt;/h1&gt;\n&lt;h2 id=\&#34;一-条件\&#34;&gt;(一) 条件：&lt;/h2&gt;\n&lt;ol&gt;\n&lt;li&gt;一台vps&lt;/li&gt;\n&lt;li&gt;一个域名&lt;/li&gt;\n&lt;li&gt;谷歌账号&lt;/li&gt;\n&lt;/ol&gt;\n&lt;h2 id=\&#34;二-步骤\&#34;&gt;(二) 步骤：&lt;/h2&gt;\n&lt;h3 id=\&#34;配置网站\&#34;&gt;配置网站&lt;/h3&gt;\n&lt;p&gt;这里推荐宝塔，太方便了&lt;/p&gt;\n&lt;ol&gt;\n&lt;li&gt;\n&lt;p&gt;安装宝塔&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;&lt;img src=\&#34;data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAABVIAAAMRCAIAAACBPdrRAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAAEnQAABJ0Ad5mH3gAAOzASURBVHhe7P0NdBTnneD7V673Cq9u2pdYCgJhO3TstRizSGQtLQlyGEvhIoEyyE5ATiyZXRpyAvIEyT5BtkFi/stbbNknlpgYyDU0e7Fkx4LYEbEAMUTKEIsMKzmDmsFj5dojjV8EkpHDceeyps9w9v88VU91V3VXSy0hQJS/n9MHqqpb1fXe9Xue3/PUF/7X//pfGgAAAAAAcKP/Tf0PAAAAAABch7AfAAAAAADXIuwHAAAAAMC1CPsBAAAAAHCtL/y/776nBgEAAAAAgLt8IRgMqsFREn84bdo0NQIAAAAAmBjOnj3r8XjUCD73SPIHAAAAAMC1CPsBAAAAAHAtwn4AAAAAAFyLsB8AAAAAANci7AcAAAAAwLUI+wEAAAAAcC3CfgAAAAAAXIuwHwAAAAAA1yLsBwAAAADAtb4QDAbV4CiJP5w2bZoawdUXCg599N47gUBvamFZ7hQ10dllTbtJ/NfftutX74j/Mx4oz0vX35D623f8qkf8P/OB1fmRqfH1H2/41dufioGbvYvKCrxJxtTEhP9W+1LOQw/lpOgTAQAAAFxVZ8+e9Xg8agSfe4T9N4r+phVLak/LocwnD/qXxg3Y+w9WlW7XnthXW5geqMv2NYhJy/1dazONd4XA9mzfPvF/mb+rMjI1jmBXnW91Q68+nHS3b9fu8sxkfSQBobf9q5fvCOjDSfNrDjxbnC4LIwAAAABcXYT9sHJj2D/YXLF4c4cakcp2d1XOUcPjbuhgxUt31I/r/M1aerv+k/4jetivpeeWLM74oj4YkXrfI0szPUNt1Q9VHbmgacm5VXtL+h+q0MP+Wn/6O2+eNz4Xnk9m4apss/Ag9b7SksyYy0J/6+aKDc1GzK/MKN7yfE3h7WpsOP3NFd/b3HFRjQlE/gAAAMC1QdgPK5eF/UPNaws2n1AjNvNqWrcXj3eSufq68S5WMGvpRyW8gire9hY/XeZ5crMe9tfUvLvZebMouTWH6outDQeCPc3PV28+qIf8ybk1jVu8LatX7+4JyXFv8ZM15Q9mpsQP4EPvNa1bUavH/Em5G/eW9VWv2SdnlTSnfNfzvtjyBQAAAADjiLAfVq4K+8309Tjsue5XbuhgRcEmmVVwtcL+5JSMGanGpPhC/W/3yl1oKdcIvdd8+E/5i+7qfGZBVbMYH1Vt/4XejgO11bs61WERqd4P9R6o9j3dpqZPzixcXvLIgvyMdHtj/8vBnpa66k1GjkBSxqpde1dnJl3ub163dPNxvdBgck751i2+uTTzBwAAAK4Wwn5YuSjsP1WXvUrVkVvjcEtZQEyd9pW56mF/JJIPtm1/Jp
